import React from "react";
import alertStyle from "./alert.module.css";

export const Alert = ({ success, message }) => {
  return (
    <div>
      <div
        className={`${success ? `${alertStyle.green}` : `${alertStyle.red}`} ${
          alertStyle.alertItem
        }`}
      >
        {message}
      </div>
    </div>
  );
};
